// ArtistTile.jsx
import React from "react";
import artist from "../../data/artist";
import "./ArtistTile.scss";
import Button from "../button/Button";

const ArtistTile = (props) => {
  return (
    <div className="artistStyle">
        <div className="artistStyle__content">
        <h1>{props.artistText}</h1>
      <Button className="artistStyle__button" buttonText={"Find out more"} isSecondary={true} />
        </div>
      <img className="artistStyle__img" src={props.pic} alt="band pic"/>
    </div>
  );
};

export default ArtistTile;
